import styled from 'styled-components';

export const Container = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  background-color: rgb(43, 135, 209);
  width: 100%;
  height: 540px;
`;

export const Question = styled.label`
  font-size: 40px;
  color: white;
`;
